    public string GetCode()
    {
        string code = "";
        Random random = new Random();
        int num = random.Next(1000);
        int minut = System.DateTime.Now.Minute;
        int second = System.DateTime.Now.Second;
        code = Convert.ToString(num + minut + second);
        return code;
    }
